description:
Interview with a milkman (1996)	


Cast

 Jon Dough, Bobby Vitale, Laura Palmer, Steve Drake, Kimberly Kummings

Beautiful women engaged in some wonderfully erotic escapades. You gotta envy those milkmen. I was especially impressed with Laura Palmer and Paisley Hunter. Both are so lovely and sexy in this story about the problems of delivering milk.


